import logo from './img/Unofficial_JavaScript_logo_2.svg.png'
import './App.css';
import 'animate.css'
import React from 'react';
import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import MainBook from './Components/MainBook'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo, animate__heartBeat" alt="logo" />
          <Routes>

          </Routes>
          <a
            className="App-link"
            href={<MainBook />}
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn Java Script
          </a>

        </header>
      </div>
    </BrowserRouter>
  );
}

export default App;
